* {
  box-sizing: border-box;
  outline: none;
}

body {
  position: relative;
}

.font {
  font-size: 20px;
}

* {
  margin: 0px;
  padding: 0px;
  box-sizing: border-box;
}

html {
  font-family: "san-sarif";
}

a {
  text-decoration: none;
}

section {
  min-height: 100vh;
}

.container {
  display: flex;
  flex-direction: row;
}

h1 {
  margin: 0;
  padding: 0;
}

body {
  overflow-x: hidden;
}

header {
  min-height: 100%;
  background: linear-gradient(180deg, rgba(0, 0, 0, 0.8), rgba(0, 0, 0, 0.5)), url("/38471123cd2c8e6dc62c26c07aab4a63.jpg");
  background-size: cover;
  background-repeat: no-repeat;
  background-position: 50% 80%;
}

.nav {
  background: transparent;
  width: 100%;
  height: 15vh;
}

.nav > .container {
  width: 90%;
  margin: 0 auto;
  display: grid;
  grid-template-columns: 1fr 3fr;
  align-items: center;
  height: 100%;
}

.nav__logo {
  color: white;
}

/* HAMBURGER */
.nav__hamburger {
  display: none !important;
  z-index: 4;
}

.change .bar1 {
  -webkit-transform: rotate(-45deg) translate(-9px, 6px);
  transform: rotate(-45deg) translate(-9px, 6px);
}

.change .bar2 {
  opacity: 0;
}

.change .bar3 {
  -webkit-transform: rotate(45deg) translate(-8px, -8px);
  transform: rotate(45deg) translate(-8px, -8px);
}

.bar1, .bar2, .bar3 {
  width: 35px;
  height: 3px;
  background-color: #cccccc;
  margin: 6px 0;
  transition: 0.4s;
}

.nav__hamburger {
  display: inline-block;
  cursor: pointer;
}

/* END HAMBURGER */
.nav__menu {
  justify-self: end;
  font-family: "Poppins", sans-serif;
  letter-spacing: 1px;
  font-size: 1.2rem;
}
.nav__menu a {
  color: #e6e6e6;
  transition: 0.5s color;
  margin: 0 2rem;
  padding-bottom: 0.5rem;
}
.nav__menu a:hover {
  color: #e67e22;
}
.nav__menu :last-child {
  border: 2px solid transparent;
  border-radius: 50px;
  padding: 1rem;
  background-color: #e67e22;
  color: #e6e6e6;
  transition: color 0.5s, background-color 0.5s;
}
.nav__menu :last-child:hover {
  color: #e67e22;
  background: white;
}

.main {
  height: 85vh;
}
.main > .container {
  position: relative;
  height: 100%;
  width: 90%;
  margin: 0 auto;
}

.main__title {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  margin-top: -4rem;
}
.main__title h1 {
  color: #e67e22;
  font-size: 4rem;
}

.arrow__bottom {
  position: absolute;
  bottom: 0;
  color: #e67e22;
  text-align: center;
  width: 100%;
  margin: 30px auto;
}
.arrow__bottom .fa {
  -webkit-transform: rotate(90deg);
  transform: rotate(90deg);
  font-size: 4rem;
}

.section__gallery {
  display: grid;
  grid-template-columns: 1fr 1fr 1fr;
  grid-template-rows: 1fr 1fr;
}

.gallery__box {
  background: linear-gradient(to bottom, rgba(0, 0, 0, 0.7), black);
  cursor: pointer;
}
.gallery__box img {
  display: block;
  height: 100%;
  width: 100%;
  opacity: 0.2;
  transition: opacity 0.5s;
}

.section__contact {
  position: relative;
  height: 50vh;
  background: #e67e22;
}

.contact__main {
  width: 80%;
  margin: 0 auto;
  display: grid;
  grid-template-columns: 1fr;
  justify-items: center;
  grid-row-gap: 20px;
  color: #f2f2f2;
  padding-top: 35px;
}
.contact__main a {
  background: transparent;
  border: 1px solid white;
  border-radius: 50px;
  padding: 10px;
  color: white;
  transition: background-color 0.5s, color 0.5s;
}
.contact__main a:hover {
  background-color: white;
  color: #e67e22;
}

.section__footer {
  background-image: linear-gradient(180deg, rgba(0, 0, 0, 0.7), rgba(0, 0, 0, 0.4)), url("/00e843b70362e5c839c9ee6197f8118f.jpg");
  background-repeat: no-repeat;
  background-position: 50% 70%;
  background-size: cover;
  min-height: 50vh;
  display: grid;
  grid-template-areas: ". footer__main ." "footer__street footer__main item4" ". footer__main .";
  justify-items: center;
  align-items: center;
}
.section__footer > .footer__main {
  display: grid;
  grid-template-rows: 1fr 1fr 1fr 1fr;
  grid-area: footer__main;
  grid-row-gap: 20px;
  margin-top: 20px;
  justify-self: center;
  margin-left: -60px;
}
.section__footer > .footer__main > .copyright {
  margin-top: 30px;
  color: white;
  justify-self: center;
}
.section__footer > .footer__main hr:before {
  content: "";
  display: block;
  position: absolute;
  right: 0;
  max-width: 100%;
  width: 100%;
}
.section__footer > .footer__main .socialMedia .fa {
  font-size: 18px;
  border: 1px solid white;
  padding: 10px;
  border-radius: 50%;
  margin: 0 5px;
  color: white;
}
.section__footer > .footer__main .fa-facebook {
  background-color: #1877f2;
}
.section__footer > .footer__main .fa-twitter {
  background-color: #1da1f2;
}
.section__footer > .footer__main .fa-youtube {
  background-color: #ff0000;
}
.section__footer > .footer__main .fa-instagram {
  background-color: #c32aa3;
}
.section__footer > .footer__main h1 {
  color: white;
}
.section__footer > .footer__main input {
  border: 1px solid white;
  border-radius: 50px;
  background: white;
  opacity: 0.7;
  padding: 5px;
  padding-left: 8px;
}
.section__footer > .footer__street {
  grid-area: footer__street;
  color: white;
  letter-spacing: 1px;
}
.section__footer > .item3 {
  grid-area: item3;
}
.section__footer > .item4 {
  grid-area: item4;
  color: white;
}
.section__footer .grid-container {
  width: 100%;
  height: 100%;
  grid-template-rows: repeat(3, 1fr);
  grid-template-columns: repeat(3, 1fr);
}

.inputInside {
  position: relative;
}
.inputInside button {
  position: absolute;
  background-color: #e67e22;
  border: transparent;
  color: white;
  cursor: pointer;
  font-size: 0.8rem;
  right: 0;
  border-radius: 50%;
  height: 30px;
  width: 30px;
}

/* STICKY NAVBAR */
.nav--sticky {
  background-color: #353b48;
  z-index: 1000;
  opacity: 1;
  position: fixed;
  top: 0;
  width: 100%;
}

/* END STICKY NAVBAR */
/* MEDIA QUERIES */
@media only screen and (max-width: 1200px) {
  .nav__menu {
